import "./main.css"
import { init } from 'ityped'
import { useEffect, useRef } from "react"

// console.log(textRef)

export default function Main() {

    const textRef = useRef();

    useEffect(() => {
        init(textRef.current, { 
            showCursor: false, 
            strings: ['Developer', 'Programmer',  ]
        });
    }, [])

    return (
        <div className="main" id="main">

            {/* Left side with photo */}
            <div className="left">
                <div className="imgContainer">
                    <img class="me" src="assets/Me.JPG" alt="Photo for main page"/>
                </div>
            </div>

            {/* Right side with intro */}
            <div className="right1">
                <div className="wrapper">
                    <h2>Hi there, I'm</h2>
                    <h1>Christine Nguyen</h1>
                    <h3>Developer <div class="pro" ref={textRef}>Programmer</div></h3>
                </div>
                <a href="#works">
                    <div class="down" scr="assets/down.png" alt="Down arrow"/>
                </a>
            </div>
        </div>
    )
}
